import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route}
    from 'react-router-dom';
import './App.css';
import Home from "./components/home/home";

function App() {
    return (
        <Router>
        <Routes>
            <Route exact path="/" element={<Home page={2} />} />
        </Routes>
        </Router>
    );
}

export default App;
